// Static file serving for the React app
const STATIC_FILES = {
  '/': { content: getIndexHTML(), contentType: 'text/html' },
  '/index.html': { content: getIndexHTML(), contentType: 'text/html' },
  '/manifest.json': { content: getManifest(), contentType: 'application/json' },
  '/favicon.ico': { content: getFavicon(), contentType: 'image/x-icon' }
};

export async function serveStatic(request, env, ctx) {
  const url = new URL(request.url);
  let path = url.pathname;

  // Handle SPA routing - serve index.html for non-API routes
  if (!path.startsWith('/api/') && !STATIC_FILES[path] && !path.includes('.')) {
    path = '/';
  }

  const staticFile = STATIC_FILES[path];
  
  if (staticFile) {
    return new Response(staticFile.content, {
      headers: {
        'Content-Type': staticFile.contentType,
        'Cache-Control': 'public, max-age=3600'
      }
    });
  }

  // Return 404 for unknown static files
  return new Response('Not Found', { status: 404 });
}

